export function doesExistUser(emailOrUsernameOrPhoneNumber, users) {
  users.map(user => {
    if(user.username === emailOrUsernameOrPhoneNumber || user.email === emailOrUsernameOrPhoneNumber)
      return true;
    return false;
  });
}
